        <div class="container-user">
          <form>
            <div class="input-box">
              <i class="fas fa-user"></i>
              <input
                type="text"
                required="required"
                value={fill.Name}
                onChange={handleChange}
                name="Name"
              />
              <span>Full Name</span>
            </div>
            <div class="input-box">
              <i class="fas fa-at"></i>
              <input
                type="email"
                required="required"
                value={fill.Email}
                onChange={handleChange}
                name="Email"
              />
              <span>Email Address</span>
            </div>
            <div class="input-box">
              <i class="fas fa-lock"></i>
              <input
                type="password"
                required="required"
                value={fill.Password}
                onChange={handleChange}
                name="Password"
              />
              <span>Password</span>
            </div>
            <div class="input-box">
